bidding.addInfo:
По первой части заявки участником закупки указывается согласие участника аукциона на поставку товара указанного в разделе 4 документации об аукционе в случае, если этот участник предлагает  для поставки товар, в отношении которого в документации о аукционе содержится указание на товарный знак (его словесное обозначение) (при наличии), знак обслуживания (при наличии), фирменное наименование (при наличии), патенты (при наличии), полезные модели (при наличии), промышленные образцы (при наличии), наименование страны происхождения товара  в виде прикрепленного файла.
Во второй части заявки участник закупки предоставляет следующие документы:
- декларация о соответствии участника электронного аукциона требованиям, установленным 1) – 5) раздела 3 настоящей документации;
При составлении декларации необходимо конкретно указать информацию, предусмотренную пунктом 4 раздела 3 настоящей документации в отношении лиц, имеющихся у участника закупки: 
физическое лицо - в отношении себя;
юридическое лицо - в отношении руководителя, членов коллегиального исполнительного органа, лица, исполняющего функции единоличного исполнительного органа, главного бухгалтера.
- решение об одобрении или о совершении крупной сделки либо копия данного решения в случае, если требование о необходимости наличия данного решения для совершения крупной сделки установлено федеральными законами и иными нормативными правовыми актами Российской Федерации и (или) учредительными документами юридического лица и для участника электронного аукциона заключаемый контракт или предоставление обеспечения заявки на участие в электронном аукционе, обеспечения исполнения контракта является крупной сделкой;
- декларация в произвольной форме о соответствии участника закупки требованиям, установленным частью 2 статьи 29 статьей 29 Федерального закона от 05.04.2013 №44-ФЗ «О контрактной системе в сфере закупок товаров, работ, услуг для обеспечения государственных и муниципальных нужд»;
- декларация о принадлежности участ

applicationGuarantee.procedureInfo:
Для участия в электронном аукционе участник закупки обязан внести денежные средства в качестве обеспечения заявки в размере 2 % от начальной (максимальной) цены контракта, что составляет  277 769 (двести семьдесят семь тысяч семьсот шестьдесят девять) рублей 44 копейки на счет оператора электронной площадки в банке.
Оператор электронной площадки перечисляет денежные средства Заказчику в случаях:
1)    уклонения или отказа участника закупки заключить контракт;
2) непредставления или предоставления с нарушением условий, установленных Федеральным законом от 05.04.2013 № 44-ФЗ «О контрактной системе в сфере закупок товаров, работ, услуг для обеспечения государственных и муниципальных нужд», до заключения контракта заказчику обеспечения исполнения контракта;
по следующим реквизитам:
УФК по Красноярскому краю (МКУ города Красноярска «УКС», л/с 05193031860) ИНН 2451000430 КПП 246601001, Отделение Красноярск г. Красноярск, БИК 040407001, счет № 40302810400003000062

requirement.content:
К участникам закупки устанавливаются следующие требования в соответствии с ч. 1 и ч.1.1 ст. 31 Федерального закона «О контрактной системе в сфере закупок товаров, работ, услуг для обеспечения государственных и муниципальных нужд» от 05.04.2013 № 44-ФЗ: согласно пунктам 1)-6) раздела 3 документации об электронном аукционе - 1) непроведение ликвидации участника закупки - юридического лица и отсутствие решения арбитражного суда о признании участника закупки - юридического лица или индивидуального предпринимателя несостоятельным (банкротом) и об открытии конкурсного производства;
2) неприостановление деятельности участника закупки в порядке, установленном Кодексом Российской Федерации об административных правонарушениях, на дату подачи заявки на участие в закупке;
3) отсутствие у участника закупки недоимки по налогам, сборам, задолженности по иным обязательным платежам в бюджеты бюджетной системы Российской Федерации (за исключением сумм, на которые предоставлены отсрочка, рассрочка, инвестиционный налоговый кредит в соответствии с законодательством Российской Федерации о налогах и сборах, которые реструктурированы в соответствии с законодательством Российской Федерации, по которым имеется вступившее в законную силу решение суда о признании обязанности заявителя по уплате этих сумм исполненной или которые признаны безнадежными к взысканию в соответствии с законодательством Российской Федерации о налогах и сборах) за прошедший календарный год, размер которых превышает двадцать пять процентов балансовой стоимости активов участника закупки, по данным бухгалтерской отчетности за последний отчетный период. Участник закупки считается соответствующим установленному требованию в случае, если им в установленном порядке подано заявление об обжаловании указанных недоимки, задолженности и решение по такому заявлению на дату рассмотрения заявки на участие в определении подрядчика не принято;
4) отсутствие у участника закупки - физического лица либо у руководителя, членов коллег
